import React from 'react';
import Head from './Head';
import styles from './Produtos.module.css';

const Produtos = () => {
  return (
    <>
      <Head title="Produtos" />
      <div className={styles.produtos}>
        <h2>Produtos</h2>
      </div>
    </>
  );
};

export default Produtos;
